import React, { useState, useEffect } from 'react';
import { Box, Container, Typography, Grid, Paper, Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import { Link } from 'react-router-dom';
import api from '../../services/api';

function Rooms() {
  const [rooms, setRooms] = useState([]);

  useEffect(() => {
    fetchRooms();
  }, []);

  const fetchRooms = async () => {
    try {
      const response = await api.getRooms();
      setRooms(response.data);
    } catch (error) {
      console.error('Error fetching rooms:', error);
    }
  };

  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this room?')) {
      try {
        await api.deleteRoom(id);
        fetchRooms(); // Refresh the list
      } catch (error) {
        console.error('Error deleting room:', error);
      }
    }
  };

  return (
    <Box sx={{ display: 'flex' }}>
      {/* Sidebar - menggunakan style yang sama dengan Dashboard */}
      <Box sx={{ 
        width: 240, 
        bgcolor: '#1976d2',
        minHeight: '100vh',
        p: 3,
        color: 'white'
      }}>
        <Typography variant="h6" sx={{ mb: 4, fontWeight: 'bold' }}>
          Admin Dashboard
        </Typography>
        <Button
          component={Link}
          to="/admin/dashboard"
          fullWidth
          sx={{ color: 'white', mb: 2 }}
        >
          Dashboard
        </Button>
        <Button
          component={Link}
          to="/admin/rooms"
          fullWidth
          sx={{ color: 'white', mb: 2 }}
        >
          Rooms
        </Button>
        <Button
          component={Link}
          to="/"
          fullWidth
          sx={{ color: 'white', mt: 'auto' }}
        >
          Logout
        </Button>
      </Box>

      {/* Main content */}
      <Box sx={{ flexGrow: 1, p: 3 }}>
        <Container maxWidth="lg">
          <Box sx={{ mb: 4, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
            <Typography variant="h4" sx={{ fontWeight: 'bold' }}>
              Manajemen Kamar
            </Typography>
            <Button
              variant="contained"
              sx={{
                bgcolor: '#1976d2',
                '&:hover': { bgcolor: '#1565c0' }
              }}
            >
              Tambah Kamar
            </Button>
          </Box>

          <Paper sx={{ p: 3 }}>
            <TableContainer>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>Tipe Kamar</TableCell>
                    <TableCell>Harga/Malam</TableCell>
                    <TableCell>Total Kamar</TableCell>
                    <TableCell>Kamar Tersedia</TableCell>
                    <TableCell>Aksi</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {rooms.map((room) => (
                    <TableRow key={room.id}>
                      <TableCell>{room.room_type}</TableCell>
                      <TableCell>Rp {room.price}</TableCell>
                      <TableCell>{room.room_number}</TableCell>
                      <TableCell>{room.status}</TableCell>
                      <TableCell>
                        <Button
                          variant="contained"
                          size="small"
                          sx={{ mr: 1 }}
                          onClick={() => handleEdit(room.id)}
                        >
                          Edit
                        </Button>
                        <Button
                          variant="contained"
                          color="error"
                          size="small"
                          onClick={() => handleDelete(room.id)}
                        >
                          Hapus
                        </Button>
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        </Container>
      </Box>
    </Box>
  );
}

export default Rooms;
